import React from 'react';
import './Style.css';
import topbar from './components/topbar';


function App() {
    return (
      <div className="top-bar">
        <div className="logo">Mon Site Web</div>
        <nav>
          <ul>
            <li><a href="/">Accueil</a></li>
            <li><a href="/services">Services</a></li>
            <li><a href="/contact">Contact</a></li>
          </ul>
        </nav>
      </div>
    );
  }
  
  export default App;
